descriptor.controllerScript:
self.onInit = function() {
    self.ctx.gauge = new TbAnalogueRadialGauge(self.ctx, 'radialGauge');    
}

self.onDataUpdated = function() {
    self.ctx.gauge.update();
}

self.onResize = function() {
    self.ctx.gauge.resize();
}

self.onMobileModeChanged = function() {
    self.ctx.gauge.mobileModeChanged();
}

self.typeParameters = function() {
    return {
        maxDatasources: 1,
        maxDataKeys: 1,
        singleEntity: true,
        defaultDataKeysFunction: function() {
            return [{ name: 'temperature', label: 'Temperature', type: 'timeseries' }];
        }
    };
}

self.onDestroy = function() {
    self.ctx.gauge.destroy();
}
